  `parent_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '父部门id',
  `dept_num` int(5) NOT NULL DEFAULT '0' COMMENT '部门人数',
  `creator_id` bigint(20) DEFAULT NULL COMMENT '创建人id',
